Estampe, Epreuve
Cinquante deux éléments du portfolio sur trente cinq feuilles pliées en deux et une chemise :
une page de faux titre avec une reproduction en couleurs sur une chemise en papier fort (44,8 x 105 cm) ;
une page de titre (sur une feuille pliée en deux contenant une autre feuille pliée en deux avec : un justificatif de tirage et une reproduction) ;
un justificatif de tirage signé :
en bas à gauche : Miró, en bas à droite : André Breton ;
une phototypie en couleurs (il s'agit de la même que celle qui se trouve sur l'emboîtage) ;
un achevé d'imprimer sur une feuille pliée en deux contenant la lithographie originale ;
un sommaire (sur une feuille pliée en deux) ;
un texte introductif d'André Breton (sur neuf feuillets foliotés de 5 à 12 sur trois feuilles pliées en deux ;
vingt-deux textes d'André Breton "Proses parallèles" datés octobre-novembre 1958 se rapportant à chacune des planches du portfolio (sur cinq feuilles pliées en deux) ;
vingt-deux intercalaires pliés en deux, titrés et numérotés ;
une table des matières illustrée (sur une feuille pliée en deux).

La chemise contient l'ensemble des éléments du portfolio.
Chaque intercalaire titré et numéroté contient la planche du même nom. 
La table des matières est en fin de portfolio.
Typographie sur vélin d'Arches
